// src/components/Home.js
import React from 'react';
import Banner from './Banner';
import SlidingBanner from './SlidingBanner';

function Home() {
  return (
    <div>
      <Banner />
      <SlidingBanner />
      <h1>Welcome to My Blog</h1>
      <p>This is the home page of my blog.</p>
    </div>
  );
}

export default Home;
